column826:
02/Apr/24 3:44 PM;kirill.leibov1@vodafone.com;I think, the CR604 was especially designed as the solution for eliminating all other retries by replacing them with a unique control mechanism.

So from my point of view, we have better to remove, in opposite, the historical retry mechanism and to provide the corresponding mandatory configuration for CR604.

Except, they are some additional criticality in this especial case.;;;

column829:
