column832:
03/Apr/24 5:05 PM;simon.auch@vodafone.com;The system on VKD site does not remember the full details of the last status update sent to OSF. In addition many state system on VKD side contains much more states than the few reported to OSF. For some of these state transitions if the source and target state both map to the same OSF state it would not surprise me that OSF gets "duplicated" status updates. These however are not incorrect since the order is in the state reproted.

I'm not familiar enough with the requirments for which these systems where implemented, but I would assume (especially since it behaves this way for years now) that it is to be expected that OSF might get the same update multiple times for orders.

Why these especially happen at night: maybe a side effect of some bulk jobs on VKD side.;;;

