20/Feb/24 4:42 PM;ariadne.thun1@vodafone.com;As far as I understood, the issue is happening for all scenarios which Mobile customers having more than the subscriber threshold value, which is configured in OGW: <MAX_SUBSCRIBERS_OMNIUS_360>{*}{color:#FF0000}xx{color}{*}</MAX_SUBSCRIBERS_OMNIUS_360>

