column817:
17/Jan/24 6:10 PM;simon.auch@vodafone.com;[~ran.farjun1@vodafone.com] the particular changes depend on what kind of porting should happen, which depends on the selection in OSF.

The "orderCart.serviceLines.kip[0].portingInformation.porting" object is missing either of these keys (with corresponding objects from the schema):
 * singleConnections
 * allSingleConnections
 * systemConnection

Examples:

porting a single/multiple numbers
{code:java}
"portingInformation": {
  "porting": {
    "carrier": {
      "inhouse": {
        "carrierContractCancel": {
          "endOfTermDate": "2024-02-10",
          "endOfTermMode": "END_DATE"
        },
        "carrierId": "DEU.VFDE"
      }
    },
    "singleConnections": [
      {
        "areaCode": "0176",
        "callNumber": "1234567"
      }
    ]
  }
}, {code}
porting also non listed numbers:
{code:java}
"portingInformation": {
  "porting": {
    "carrier": {
      "inhouse": {
        "carrierContractCancel": {
          "endOfTermDate": "2024-02-10",
          "endOfTermMode": "END_DATE"
        },
        "carrierId": "DEU.VFDE"
      }
    },
    "allSingleConnections": {
      "areaCode": "0176",
      "callNumber": "1234567"
    }
  }
}, {code}
The "systemConnection" is only relevant for porting whole blocks of phone numbers which I think is not a use case in OSF.

 

Note that for other use cases like handing the porting information in later the structure is different.;;;

